var tipuesearch = {"pages": [{'title': 'About', 'text': '40823101 林晏鈴 \n 倉儲: https://github.com/40823101/cd2021 \n 網頁: https://40823101.github.io/cd2021/ \n 第一次分組網頁: https://40823101.github.io/cd2021-ag4/ \n', 'tags': '', 'url': 'About.html'}, {'title': 'Topic', 'text': '', 'tags': '', 'url': 'Topic.html'}, {'title': 'w1', 'text': '2021/02/25 --- 今天講解這學期的須完成的工作和評分方式，並用github將個人網頁cd2021製作出來，並重新熟悉pelican.leo這程式，熟悉ctrl+i，ctrl+l及ctrl+r的應用 \n Github:https://github.com/40823101/cd2021 \n Github page:https://40823101.github.io/cd2021/content/index.html \n \n Github: \n \n 近端網站: \n \n 遠端網站: \n \n \n Blog: \n \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'Stage1-ag4', 'text': '組員: 40823101 林晏鈴 、 40823104 葉沛翎 \n 組員個人網站: 40823101 、 40823104 \n 小組網站: GitHub 、 CMSIMDE \n \n \n', 'tags': '', 'url': 'Stage1-ag4.html'}, {'title': 'w2', 'text': '今天確認主題為挖土機手臂結構， \n 動機為想 研究挖土機手臂構造及作動原理， \n 本周從AUTOCAD開始繪製2D圖檔，再利用SOLIDWORK繪製3D圖， \n 預計下周用 CoppeliaSim模擬測試及修改。 \n 參考資料: \n https://kknews.cc/zh-tw/news/nbx58m5.html \n 立體圖繪製影片: \n \n \n \n \n \n \n 立體組合圖影片: \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '將挖土機手臂的組合圖stl檔以coppeliasim作動測試 \n  (發現soildwork的組合圖轉為stl檔後會自動拆開,變成一個個零件stl檔,後來改成匯出成step檔後放入inventor,再轉成stl檔即可為完整的組合圖) \n 測試影片1:將組合件建立從屬關係,並在三個主動軸上添加虛擬軸,結果失敗,各零件四散 \n 結果1:失敗,各零件四散,疑似從屬關係不順 \n \n \n 測試影片2:重新建立組合件之從屬關係,並在各軸上增加虛擬軸以加強物件之間的約束 \n 結果2: 失敗,各零件四散,虛擬軸似乎和物件拘束關係無關 \n \n \n 測試影片3:以手動方式轉動虛擬軸 \n 結果3:失敗, 疑似因為我們的主題挖土機手臂需要多個零件互相約束,但coppeliasim只能以一個主動件配合多個從動件,無法讓一個零件既是主動件也是從動件,所以用程式作動時會出現零件約束不足,因此無法順利作動並且零件四散 \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w4', 'text': '上台報告 \n PDF: https://40823104.github.io/stage1-ag4/downloads/%E5%8D%94%E5%90%8C%E7%94%A2%E5%93%81%E8%A8%AD%E8%A8%88%E8%88%87%E5%AF%A6%E7%BF%92.pdf \n reveal: https://40823104.github.io/stage1-ag4/reveal/index.html \n 影片: \n \n 各組影片名稱更名及長度 \n https://drive.google.com/drive/folders/1n4L-tWhAaJEzP7O9FdyERihYsy7aEJ07?usp=sharin \n \n', 'tags': '', 'url': 'w4.html'}, {'title': 'Stage2-ag4', 'text': '組員: 40823101 林晏鈴 、 40823104 葉沛翎 、 40823119 林郁凱 、 40823150 蘇鷺瑋 \n 組員個人網站: 40823101 、 40823104 、 40823112 、 40823150 \n 小組網站: GitHub 、 CMSIMDE \n stage1倉儲: ag4 、 ag11 \n stage1網站: ag4 、 ag11 \n \n', 'tags': '', 'url': 'Stage2-ag4.html'}, {'title': 'w5', 'text': '本周確定組別(stage2-ag4)以及組員(40823101、40823104、4023119、40823150)，並思考出大致的主題方向，這次主題將以腳踏車為主，也有可能再加入其他本組的構想，將再待觀察及提案。 \n 參考資料: http://www.bikefun.com.tw/m/405-1602-54117,c12798.php \n', 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': '', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '', 'tags': '', 'url': 'w8.html'}, {'title': 'w9', 'text': '', 'tags': '', 'url': 'w9.html'}]};